Requirements:
Réaliser la maintenance électromécanique des équipements (moteurs, pompes, alternateurs, compresseurs…) ;
Assurer la gestion du système de contrôle d'accès ;
Réaliser les diagnostics et les dépannages ;
Garantir le bon fonctionnement, la disponibilité et le suivi des évolutions des infrastructures systèmes.

Superviser une équipe d'ingénieurs en informatique
Elaborer la stratégie et la politique en matière de sécurité informatique;
Évaluer et préconiser les investissements informatiques correspondants aux besoins des métiers exprimés en tenant compte de leurs efficacité et de la maîtrise des risques;
Concevoir une organisation optimale des flux d’informations de l’entreprise;
Garantir le respect des règles, procédures et instructions;
Elaborer les tableaux de bord.

